import { createSlice } from '@reduxjs/toolkit'
export const prodact=createSlice({
    initialState:[{id:1,title:"Abdullah"}],
    name:"prodact",
    reducers:{
        addprodact:(state,action)=>{
            state.push(action.payload)

        },
        GetallPrordact:()=>{}
    }
})
export const{addprodact,GetallPrordact}=prodact.actions
export default prodact.reducer
